import Vue from 'vue';
import App from './App.vue'
import axios from 'axios'
import vuetify from './plugins/vuetify'
import { loadFonts } from './plugins/webfontloader'

loadFonts()

Vue.config.productionTip = false;

Vue.use(VueRouter);
Vue.use(Vuetify);

// const vuetify = new Vuetify({

// });

new Vue({
  render: h => h(App),
  vuetify,
}).mount('#app');
